private Set<String> getDeleteFails(List<StoppableIndexingThread> threads) {
  Set<String> deleteFails = new HashSet<String>();
  for (StoppableIndexingThread thread : threads)   {
    deleteFails.addAll(thread.getDeleteFails());
  }
  return deleteFails;
}

